/* eslint-disable no-useless-constructor */
import React from "react";

const Education = (props) => {

    const { education } = props;

    return(
        <div className="educationDiv">
            {education.map((degree) => {
                return <div className="degree" key={degree.id}>
                            <div className="school">
                                <p>{degree.school}</p>
                            </div>
                            <div className="major">
                                <p>{degree.major}</p>
                            </div>
                            <div className="minor">
                                <p>{degree.minor}</p>
                            </div>
                            <div className="degreeStartDate">
                                <p>{degree.degreeStartDate}</p>
                            </div>
                            <div className="degreeEndDate">
                                <p>{degree.degreeEndDate}</p>
                            </div>
                            <button className="editEducation" onClick={editEducation}>Edit Education</button>
                            <button className="deleteEducation" onClick={deleteEducation}>Delete Education</button>
                        </div>
            })}
        </div>

    )
}


export default Education;
